// Contact.js
import React, { useState } from "react";
import "./contact.css"; // styling
import { FaPhoneAlt, FaEnvelope, FaMapMarkerAlt } from "react-icons/fa";

function Contact() {
  const [formData, setFormData] = useState({
    name: "",
    email: "",
    subject: "",
    message: ""
  });

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    alert("✅ Your message has been sent successfully!");
    console.log(formData);
    setFormData({ name: "", email: "", subject: "", message: "" });
  };

  return (
    <div className="contact-page">
      <h2 className="section-title">CONTACT US</h2>
      <h3>If You Have Any Query, Feel Free To Contact Us</h3>

      <div className="contact-info">
        <div className="info-box">
          <FaPhoneAlt className="icon" />
          <p>Call to ask any question</p>
          <a href="tel:+0123456789">+012 345 6789</a>
        </div>
        <div className="info-box">
          <FaEnvelope className="icon" />
          <p>Email to get free quote</p>
          <a href="mailto:info@example.com">info@example.com</a>
        </div>
        <div className="info-box">
          <FaMapMarkerAlt className="icon" />
          <p>Visit our office</p>
          <a href="#">123 Street, NY, USA</a>
        </div>
      </div>

      <div className="contact-content">
        <form className="contact-form" onSubmit={handleSubmit}>
          <div className="form-row">
            <input
              type="text"
              name="name"
              placeholder="Your Name"
              value={formData.name}
              onChange={handleChange}
              required
            />
            <input
              type="email"
              name="email"
              placeholder="Your Email"
              value={formData.email}
              onChange={handleChange}
              required
            />
          </div>
          <input
            type="text"
            name="subject"
            placeholder="Subject"
            value={formData.subject}
            onChange={handleChange}
            required
          />
          <textarea
            name="message"
            placeholder="Message"
            rows="5"
            value={formData.message}
            onChange={handleChange}
            required
          />
          <button type="submit" className="btn-submit">Send Message</button>
        </form>

        <div className="map-container">
          <iframe
            title="Google Map"
            src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d24156.054158484855!2d-74.0182328379969!3d40.7055657635346!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x0%3A0x0!2zMzXCsDA0JzE5LjIiTiA3NMKwMDEnNDUuOSJX!5e0!3m2!1sen!2sus!4v1672508952111!5m2!1sen!2sus"
            width="100%"
            height="350"
            allowFullScreen=""
            loading="lazy"
          ></iframe>
        </div>
      </div>
    </div>
  );
}

export default Contact;
